/* eslint-disable global-require */
/* eslint-disable import/no-dynamic-require */
import React from "react"
import { Link } from "react-router-dom"
import "../../../../style"
import {
  Img,
  // Button,
  PropCard,
  // Title,
  Location,
  // LocationText,
  // PropText,
  Days,
  Line,
  CardTitle,
  CardPrice,
} from "../styles/PrompCard"

// title, price, city, days, introduction, slug
// eslint-disable-next-line react/prop-types
const PromCard = ({ source, title, price, city, slug, days }) => (
  <>
    <Link to={`/tours/${slug}`}>
      <PropCard>
        <Img src={`/img/tours/${source}.jpg`} alt="promotion image" />
        <CardTitle>{title}</CardTitle>
        <Line />
        <Days>{days} Days</Days>
        <CardPrice>AUD {price}</CardPrice>
        <Location>{city}</Location>
      </PropCard>
    </Link>
  </>
)

export default PromCard
